import React from 'react';

class UsersDelete extends React.Component {

    render() {
        return (
            <div>
                <button type="button" className="btn btn-primary" id="edit-user-btn" data-toggle="modal" data-target="#edit-user-modal"
                        data-whatever="edit-user">Ред.
                </button>
            </div>
        );
    }
}

export default UsersDelete;
